import React, { Component } from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import CatDex from "./components/pages/catDex.js";


function App() {
  return (
    <div className="App">
      <Switch>
        <Route path='/' component={Home} />
        <Route path='/catdex' component={CatDex} />
      </Switch>
    </div>
  );
}

export default App;
